import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme) => ({
    photoCard: {
        width: '100%',
        height: 200,
        borderRadius: 10,
        boxShadow: '0px 5px 20px 0px grey',
        [theme.breakpoints.down('sm')]: {
            marginBottom: 20
        }
    },
    infoCard: {
        width: '100%',
        height: 200,
        borderRadius: 10,
        boxShadow: '0px 5px 20px 0px grey'
    },
    homeImg: {
        width: '100%',
        height: '100%'
    }
}))

export default useStyles
